import React from "react";

import Part from "../Part/Part";

const Content = ({ course }) => {
  return (
    <div>
      {course.parts.map((part) => (
        <Part part={part} />
      ))}
      {/* <Part part={course.parts[0]} />
      <Part part={course.parts[1]} />
      <Part part={course.parts[2]} /> */}
    </div>
  );
};

export default Content;
